import React from "react";
import Type from "../../components/Type";

const OrderPage = () => {
  return (
    <div>
      <h1>Travel Products</h1>
      <div>
        <Type orderType="products" />
      </div>
      <div style={{ display: "flex", marginTop: "20px" }}></div>
    </div>
  );
};

export default OrderPage;
